export interface LruSchema {
    key?: string;
    timestamp?: string;
}

export class Lru {
    constructor(raw?: Record<string, any>, schema?: LruSchema);
    limit(count: number): this;
    add(key: string | Record<string, any>, val?: any): this;
    [Symbol.iterator](): Iterator<any>;
    iterRaw(): Iterable<any>;
}